import React from 'react';
import './App.css';

function App() {
  const Cate = "Baju Koko";
  const Title = "Motif Bordir Abu - Dua Kantong - Putih";
  const Price = "IDR 243,950";
  const Info = "Regular Fit  Warna Putih Kemeja dengan Koko Bahan Katun Motif Bordir Biru Pada Placket, Dua kantong nyama dipakai di manapun kapanpun. tampil lebih gaya dan lebih religius. stok terbatas tunggu apa lagi segera beli keburu habis.";
  return (
    <div className="Parentbox">
      <div className="Foto">
        <img src="baju.jpg" />
      </div>
      <div className="Deskripsi">
        <p className="Cate">{Cate}</p>
        <h1 className="Title">{Title}</h1>
        <p className="Price">{Price}</p>
        <p className="Info">{Info}
        </p>
      </div>
    </div>
  );
}

export default App;
